			<span className="big-text">Sign up latest updates and offers</span>
			<div className="form">
				<input type="text" placeholder="Email Adress" />
				<button>Subscribe</button>
			</div>
			<div className="text"></div>
			</div>
		</div>;
};

export default Newsletter;
